import React from "react";
import { MDBContainer } from "mdbreact";
import DocsLink from "../components/docsLink";

const Books = () => {
  return (
    <>
      <MDBContainer className="mt-5 text-center">
        <DocsLink title="Books"  />
       
      </MDBContainer>

     
    </>
  );
};

export default Books;
